const About = () => {
    return(
        <>
            <h1>ABOUT ME</h1>
            <img src="./AC7841E6-A98C-495D-957C-D990D6C95A18.jpg" alt="img" />
            <p>¡Hola! ¡Bienvenido/a a mi página web! Permíteme presentarme. Soy Jessica y estoy encantada   de compartir un poco sobre mí contigo.
                Soy una entusiasta estudiante de programación Full Stack y estoyhttps://www.adobe.com/content/dam/cc/afc/afc/redesign-lv/ic-timers-spanish-es/ooc/Timer%20-%20Toast%20-%20Day%2002.svg inmerso/a en el emocionante mundo del desarrollo web. Aunque todavía no tengo experiencia laboral, estoy avanzada en mis estudios y tengo un sólido conocimiento de JavaScript, React y Redux. Me apasiona aprender y siempre estoy buscando oportunidades para seguir creciendo y expandiendo mis habilidades.
                Creo firmemente en la perseverancia y en la realización de nuestros sueños. Sin embargo, también creo que es importante buscar un equilibrio en la vida y no sacrificarlo todo en la búsqueda de nuestros objetivos. Creo en el poder de la amistad y el compañerismo, ya que creo que las cosas salen mejor cuando trabajamos juntos y apoyamos a los demás. Además, estoy convencida de que nuestras experiencias diarias están estrechamente vinculadas a nuestros sentimientos, pensamientos y acciones.
                ¿Por qué me motiva ser programadora? Mi mayor motivación radica en la posibilidad de trabajar mientras viajo por el mundo. Me encanta la idea de combinar mi pasión por la programación con mi amor por explorar nuevos lugares y culturas. Ser capaz de crear soluciones tecnológicas y tener un impacto positivo en la vida de las personas es lo que me impulsa a seguir aprendiendo y mejorando.
                Lo que me hace especial es mi compromiso con la excelencia. Siempre me esfuerzo por hacer las cosas de la mejor manera posible para que los demás se sientan satisfechos con mi trabajo. Me enorgullece saber que puedo tener un efecto positivo en los demás a través de mis habilidades y conocimientos.
                ¡Gracias por visitar mi página web y por tomarte el tiempo para conocerme un poco mejor! Si tienes alguna pregunta o si te gustaría contactarme, no dudes en escribirme a mi correo electrónico: jesib03@hotmail.com. Estaré encantada de responder tus consultas y establecer una conexión.
            </p>
        </>
    );
}
export default About;
